<?php

use App\Library\ControllerMain;
use App\Library\Email;
use App\Library\Session;
use App\Library\Redirect;

class FaleConosco extends ControllerMain 
{
    
    public function formularioEmail() 
    {
        return $this->loadView("restrita/faleConosco");
    }

    public function verificaEstoque() 
    {
        $FornecedorModel = $this->loadModel("Fornecedor");
        $dados['aFornecedor'] = $FornecedorModel->lista('id');

        $fornecedorNome = "";

        $ProdutoModel = $this->loadModel("Produto");
        $dados['aProduto'] = $ProdutoModel->lista('id');

        $emailRemetente = 'mayconbruno118@gmail.com';
        $nomeRemetente = 'Sistema de controle de estoque';
        $assunto = 'Alerta de estoque';

        $message = "Os seguintes produtos est√£o com o estoque abaixo do limite de alerta:<br><br>";
        $temProdutoAbaixoDoLimite = false;

        foreach ($dados['aProduto'] as $produto) {
            if ($produto['quantidade'] < 3) {
                $message .= "Nome: " . $produto['nome'] . "<br>";
                $message .= "Quantidade: " . $produto['quantidade'] . "<br>";

                foreach ($dados['aFornecedor'] as $fornecedor) {
                    if ($fornecedor['id'] == $produto['fornecedor']) {
                        $fornecedorNome = $fornecedor['nome'];
                        break;
                    }
                }

                $message .= "Fornecedor: " . $fornecedorNome . "<br><br>";
                $temProdutoAbaixoDoLimite = true;
            }
        }

        if ($temProdutoAbaixoDoLimite) {
            $this->enviaNotificacaoEstoque($emailRemetente, $nomeRemetente, $assunto, $message);
        } else {
            Session::set("exibeModalNotificacaoEstoque", true);
        }

    }

    private function enviaNotificacaoEstoque($emailRemetente, $nomeRemetente, $assunto, $mensagem)
    {
        $UsuarioModel = $this->loadModel("Usuario");
        $usuarioAdministradorEmail = $UsuarioModel->getUserEmailAdm('1');
    
        // String base64 da imagem
        $imagemBase64='data:image/png;base64,';

        // Adiciona a imagem base64 ao corpo do e-mail
        $mensagem .= '<img alt="imagem" src="data:image/png;base64,' . $imagemBase64 . '" />';
        $corpoEmail = $mensagem . '<br><br> Esse email √© disparado todos os dias com o intuito de notificar sobre o estoque.';
    
        $lRetMail = Email::enviaEmail(
            $emailRemetente, // Email do Remetente
            $nomeRemetente, // Nome do Remetente
            $assunto, // Assunto do e-mail
            $corpoEmail, // Corpo do E-mail
            $usuarioAdministradorEmail['email'] // Destinat√°rio do E-mail
        );
    
        if ($lRetMail) {
            Session::set("exibirModalEstoque", true);
        } else {
            Session::set("exibirModalEstoque", false);
        }
    }
    

    public function enviarEmail()
    {
        // Verifica se o formul√°rio foi enviado
        if ($_SERVER['REQUEST_METHOD'] === 'POST') {
            // Sanitiza e obt√©m os dados do formul√°rio
            $emailRemetente = filter_input(INPUT_POST, 'email', FILTER_VALIDATE_EMAIL);
            $nomeRemetente = filter_input(INPUT_POST, 'nome');
            $assunto = filter_input(INPUT_POST, 'assunto');
            $telefone = filter_input(INPUT_POST, 'telefone');
            $mensagem = filter_input(INPUT_POST, 'mensagem');

            // Verifica se o e-mail √© v√°lido
            if (!$emailRemetente) {
                echo "Email inv√°lido!";
                return;
            }

            // Prepara o corpo do e-mail
            $corpoEmail = $mensagem . '<br><br> Para mais informa√ß√µes para o suporte, me ligue pelo telefone: ' . $telefone . ' ou me mande um email: ' . $emailRemetente;

            // Envia o e-mail
            $lRetMail = Email::enviaEmail(
                $emailRemetente,        /* Email do Remetente */
                $nomeRemetente,         /* Nome do Remetente */
                $assunto,               /* Assunto do e-mail */
                $corpoEmail,            /* Corpo do E-mail */
                'maycon7ads@gmail.com'  /* Destinat√°rio do E-mail */
            );

            // Verifica se o e-mail foi enviado com sucesso
            if ($lRetMail) {
                Session::set("msgSuccess", "Email enviado com sucesso.");
                Redirect::page('FaleConosco/formularioEmail');
            } else {
                Session::set("msgError", "Falha tentar enviar o email.");
                Redirect::page('FaleConosco/formularioEmail');
            }
        }
    }

};